@app.server.route("/ai", methods=["POST", "GET"])
def ai():

    from dashpool_components import chatutils

    content = request.get_json()

    chatutils.PdfHighlight()

    with chatutils.Response(app, inputs=content) as resp:

        time.sleep(5)

        if random.random() < 0.999:
            resp.add(
                chatutils.Photo(
                    "https://raw.githubusercontent.com/dashpool/.github/main/media/logo.svg",
                    100,
                    100,
                    ref="ref1",
                )
            )
            resp.add(
                chatutils.Reference(
                    size=900,
                    markdown="""Test Document

* This is a test document
* It has some text
* It has some more text

```python	
print("Hello World")
```

                    """,
                    img="data:image/png;base64,",
                    ref="ref3",
                )
            )

        if random.random() < 0.999:
            resp.add(
                chatutils.PDF(
                    "http://pdfobject.com/pdf/sample.pdf",
                    highlights=[
                        chatutils.PdfHighlight(
                            content=chatutils.PdfHighlightContent(
                                "arXiv:1104.4284v1 [cond-mat. mes-hall] 21 Apr 2011 Switching spin and charge between edge states in topological insulator constrictions Viktor Krueckl and Klaus Richter Institut f ̈ur Theoretische Physik, Universit ̈at Regensburg, D-93040 Regensburg, Germany (Dated: June 15, 2018) Since the prediction of a new topological state of matter in graphene, materials acting as topological insulators have attracted wide attention. Shortly after the theoretical proposal for a mercury telluride (HgTe)-based two-dimensional topological insulator, the observation of the quantum spin Hall effect and non-local edge transport brought compelling experimental evidence for quantized conductance due to edges states.",
                                "data:image/png;base64,",
                            ),
                            position=chatutils.PdfHighlightPosition(
                                boundingRect=chatutils.PdfHighlightPositionRect(
                                    x1=10.940000534057617,
                                    y1=52.75774383544922,
                                    x2=555.3764038085938,
                                    y2=590,
                                    width=612,
                                    height=792,
                                ),
                                rects=[],
                                pageNumber=1,
                            ),
                            comment=chatutils.PdfHighlightComment("Hello World", None),
                            id="b3ae073540d8be16050b78dc2779ea5e4bca751e545ab11327455fa8a0c58a10",
                            file_id="https://arxiv.org/pdf/1104.4284",
                            file_mode="remote",
                        )
                    ],
                    name="Sample PDF",
                    ref="ref2",
                )
            )

        result_stringA = """Hello, how can I help you?    
List item 1 [ref2]  [ref1]  
List item 2 *asdfsd* **asdfasdf** [ref1]  
Unknown [ref11, ref2]
"""

        def generatorA():
            for e in result_stringA:
                time.sleep(0.01)
                yield e

        result_stringB = """Hello, how can I help you?  
* List item 1 [ref1]
* List item 2 [ref3]
"""

        def generatorB():
            for e in result_stringB:
                time.sleep(0.01)
                yield e

        result_stringC = """Hello this is a table

| Header 1 | Header 2 | Header 3 |
| -------- | -------- | -------- |
| Cell 1   | Cell 2   | Cell 3 [ref2]   |
| Cell 4 [ref1]   | Cell 5   | Cell 6 [ref3]   |
           
        
        """

        def generatorC():
            for e in result_stringC:
                time.sleep(0.01)
                yield e

        resp.add(generatorA)
        resp.add(generatorB)
        resp.add(generatorC)

        return resp.generate_response()


